import './App.css';
import React from 'react';

class App extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      name: 'cx',
      age: 16
    }
  }

  onClick = (a, e) => {
    this.setState({
      name: a,
      age: e.target.value
    })
  }
  render() {
    return (
      <div className="App">
        <div>{this.state.name}</div>
        <div>age:{this.props.age}</div>
        <button onClick={(e) => this.onClick('cxnb', e)} value='6666'>修改</button>
        <Greeting name='6666'/>
      </div>
    );
  }
}

class Greeting extends React.Component {
  constructor(props){
    super(props)
    this.state={
      name:'cxcxcxcxcxcxccx'
    }
  }
  render() {
    return (
      <div>
        <h1>{this.props.name}</h1>
        <button onClick={this.login} value='888888'>再改</button>
      </div>

    );
  }
}

class UserGreeting extends React.Component {
  render() {
    return <h1>Welcome back!</h1>;
  }
}

class GuestGreeting extends React.Component {
  render() {
    return <h1>Please sign up.</h1>;
  }
}
export default App;
